_.forEach(defaultRoutes, function (route, key) {
  _.forEach(route.children, function (brand, ke2) {
    brand.component = routes[brand.name];

    if (brand.children) {
      _.forEach(brand.children, function (brand2, key3) {
        brand2.component = routes[brand2.name];
      });
    }
  });
});

export default defaultRoutes;
export var routerRender = defaultRoutes.reduce(function (newRoutes, routes) {
  return newRoutes.concat(routes.children);
}, []);
